import React from "react";
import { data } from "../Fruits/FruitsData";

import { sellerData } from "../Seller/DataSeller";
export default function Apple() {
  const arr = window.location.href.split("/");
  const name = arr[arr.length - 1];

  const d = data.filter((d) => {
    return name === d.name.toLowerCase();
  });

  const s = sellerData.filter((p) => {
    return name === p.fruits.filter((pp) => pp.name);
  });

  console.log(s);
  return (
    <>
      {sellerData.map((items) => (
        <>
          <p>{items.name}</p>
          {items.fruits.map((na) => (
            <>
              <p>{na.name}</p>
              <p>{na.price}</p>
            </>
          ))}
          <p>{items.id}</p>
          <br></br>
        </>
      ))}
    </>
  );
}
